import React, { useState } from "react";
import axios from "axios";
import { Navigate } from "react-router-dom";

const Login = () => {
  const [passwordVisible, setPasswordVisible] = useState(false);

  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");


  const handleLoginEvent =async (e) => {
    e.preventDefault();
    setError(""); // Clear previous errors
    console.log("Email: ", email);
    console.log("Password: ", password);


    try {
      const response = await axios.post(
        "http://localhost:3000/api/auth/login",
        new URLSearchParams({ email, password }),
        { headers: { "Content-Type": "application/x-www-form-urlencoded" } }
      );

      if (response.status === 200) {
        localStorage.setItem("token", response.token);
        Navigate("/dashboard"); // Redirect to dashboard
      }
    } catch (err) {
      setError(err.response?.data?.message || "Invalid email or password");
    }
  };


  

  const togglePasswordVisibility = () => {
    setPasswordVisible(!passwordVisible);
  };

  return (
    <div className="wrapper">
      <div className="section-authentication-signin d-flex align-items-center justify-content-center my-5 my-lg-0">
        <div className="container-fluid">
          <div className="row row-cols-1 row-cols-lg-2 row-cols-xl-3">
            <div className="col mx-auto">
              <div className="mb-4 text-center mt-5">
                <img src="assets/images/logo-img.png" width="180" alt="" />
              </div>
              <div className="card">
                <div className="card-body">
                  <div className="border p-4 rounded">
                    <div className="text-center">
                      <h3 className="">Sign in</h3>

                      {error && <p style={{ color: "red" }}>{error}</p>}
                    </div>

                    <div className="form-body">
                      <form className="row g-3" onSubmit={handleLoginEvent}>
                        <div className="col-12">
                          <label
                            htmlFor="inputEmailAddress"
                            className="form-label"
                          >
                            Email Address
                          </label>
                          <input
                            type="email"
                            className="form-control"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            id="inputEmailAddress"
                            placeholder="Email Address"
                          />
                        </div>
                        <div className="col-12">
                          <label
                            htmlFor="inputChoosePassword"
                            className="form-label"
                          >
                            Enter Password
                          </label>
                          <div className="input-group" id="show_hide_password">
                            <input
                              type={passwordVisible ? "text" : "password"}
                              value={password}
                              onChange={(e) => setPassword(e.target.value)}
                              className="form-control border-end-0"
                              id="inputChoosePassword"
                              placeholder="Enter Password"
                            />
                            <button
                              type="button"
                              className="input-group-text bg-transparent"
                              onClick={togglePasswordVisibility}
                            >
                              <i
                                className={
                                  passwordVisible ? "bx bx-show" : "bx bx-hide"
                                }
                              ></i>
                            </button>
                          </div>
                        </div>
                        <div className="col-md-6">
                          <div className="form-check form-switch">
                            <input
                              className="form-check-input"
                              type="checkbox"
                              id="flexSwitchCheckChecked"
                              checked
                            />
                            <label
                              className="form-check-label"
                              htmlFor="flexSwitchCheckChecked"
                            >
                              Remember Me
                            </label>
                          </div>
                        </div>
                        <div className="col-md-6 text-end">
                          <a href="authentication-forgot-password.html">
                            Forgot Password?
                          </a>
                        </div>
                        <div className="col-12">
                          <div className="d-grid">
                            <button type="submit" className="btn btn-primary">
                              <i className="bx bxs-lock-open"></i>Sign in
                            </button>
                          </div>
                        </div>
                      </form>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
